import  React, { Component } from "react"
import {ScreenLayouts} from "./FormLayouts"
import DVForms from "../DVComponents/DVForms";

type formId = {
    Id: string
}

export class FormBuilder extends React.Component<formId> {
    constructor(props){
        super(props);
    }
    render() {
      return (
            <div>
                <DVForms style={{ width: '100%', height: 'auto', backgroundColor: "none" }} template={ScreenLayouts[this.props.Id]} value={ScreenLayouts["LoginScreenValue"]}></DVForms>
            </div>
        );
    }
  }
  export default FormBuilder;
